import React from "react";
import ReactDOM from "react-dom/client";
import reportWebVitals from "./reportWebVitals";
import "./home.css";

function App() {
  return (
    <>
      <Header />
      <Menu />
    </>
  );
}

function Header() {
  return (
    <header>
      <div className="logo">Coffee Day</div>
      <div className="nav-buttons">
        <a className="button secondary-button" href="/">
          LOG IN
        </a>
        <a
          className="button primary<Header />
      <Menu />-button "
          href="/"
        >
          SIGN UP
        </a>
      </div>
    </header>
  );
}

function Menu() {
  return (
    <div className="container">
      <div className="coffee-grid">
        <Item />
        <Item />
        <Item />
        <Item />
      </div>
    </div>
  );
}

function Item() {
  return (
    <div className="coffee-item">
      <img src="assets/coffee.png" alt="coffee" className="coffee-icon"></img>
      <div className="coffee-name">Pepperoni Pizza Slice</div>
      <div className="coffee-ingredients">
        Pepperoni, Mozzarella Cheese ,Tomato Sauce
      </div>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

